import React from "react";

import "./review-product-page.styles.css";

const ReviewProductPage = () => {
  return (
    <div className="reviewProduct__container">
      <div className="reviewProduct__leftSide">
        LEFT SIDE
        <div className="reviewProduct__imageContainer">IMAGE CONTAINER</div>
      </div>

      <div className="reviewProduct__rightSide">RIGHT SIDE
        <div className="reviewProduct__title">
        PRODUCT TITLE    
        </div> 
      </div>
    </div>
  );
};

export default ReviewProductPage;
